/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import { Link } from 'react-router-dom';
import ParticlesComponent from '../../components/Particles';
import './index.css';

function App() {
	return (
		<div className>
			<div className="container">
				<div className="title logo-text">
					<h1>Zuby.io</h1>
				</div>
			</div>
			<div className="skills has-text-centered">
				<h2 className="title has-text-weight-bold">
					<strong>Passion | Excellence | Determination | Innovation</strong>
				</h2>
			</div>

			<div className="bg">
				<ParticlesComponent />

      <div className="centered">

      <Link  to='/homepage' className="button">Go For A Ride</Link>


    </div>
			</div>

			<div />
		</div>
	);
}

export default App;
